INSERT INTO `movie` (`name`, `genre`, `directors`, `writers`, `cast`, `releaseDate`, `country`, `language`, `runTime`, `description`, `storyLine`, `id`, `sentiments`) VALUES
('Inferno', ' Action, Adventure, Crime', 'Ron Howard', 'Dan Brown (based on the novel by), David Koepp (screenplay)', 'Tom Hanks, Felicity Jones, Irrfan Khan', '28 October 2016 (USA)', 'USA', 'English', '2h 1min', 'When Robert Langdon wakes up in an Italian hospital with amnesia, he teams up with Dr. Sienna Brooks , and together they must race across Europe against the clock to foil a deadly global plot.', 'Robert Langdon is in Italy. He wakes up in a hospital with no memory of recent events. He appears to have suffered some head trauma. He is being treated by Dr. Sienna Brooks. Suddenly someone dressed as a policeman comes in and starts shooting, trying to get to Langdon. Brooks helps him. Langdon finds he received an email from a friend in Italy who told him that he too is being hunted, and he is gone into hiding with what they took. Of course he has no idea what he is talking about. He finds something in his belongings that reveals the Map of Hell which is inspired by Dante Inferno. He learns about a man Bertrand Zobrist, a billionaire who believes the world is too overpopulated and that drastic measures are needed. He plans to release a virus which he created to kill most of the planets population. Evidently he is inspired by Dante so Langdon needs to find out what he is planning, while he is being pursued by people from the World Health Organization, and one of them is someone he knows.', 2, '8.935'),
('Doctor Strange', 'Action, Adventure, Fantasy', 'Scott Derrickson', 'Jon Spaihts, Scott Derrickson', 'Benedict Cumberbatch, Chiwetel Ejiofor, Rachel McAdams', '4 November 2016 (USA)', 'USA', 'English', '115 mins', 'A former neurosurgeon embarks on a journey of healing only to be drawn into the world of the mystic arts.', 'Marvel &quot;Doctor Strange&quot; follows the story of the talented neurosurgeon Doctor Stephen Strange who, after a tragic car accident, must put ego aside and learn the secrets of a hidden world of mysticism and alternate dimensions. Based in New York City Greenwich Village, Doctor Strange must act as an intermediary between the real world and what lies beyond, utilizing a vast array of metaphysical abilities and artifacts to protect the Marvel Cinematic Universe.', 6, '9.390'),
('Befikre', 'Comedy, Crime, Romance', 'Aditya Chopra', 'Aditya Chopra (story and screenplay), Aditya Chopra (dialogue', 'Vaani Kapoor, Ranveer Singh, Elisa Bachir Bey ', ' 9 December 2016 (USA)', 'India', 'Hindi', '2h 12min', 'Set in Paris, Befikre is a free spirited, contemporary love story of Dharam and Shyra, who find love in an impulsive, engaging series of experiences. Doused in the spirit of Paris, it celebrates love- sensual, carefree and focused on living life to the fullest.', 'Befikre is a story that celebrates being carefree in love. A quintessential Delhi boy Dharam (Ranveer Singh) comes to Paris for work in search of an adventure. Just when he was about to embark on this journey of his life he bumps into a wild, free spirited, French born Indian girl Shyra (Vaani Kapoor). A feisty romance ensues between the two in which both of their personalities- one being an equal match for the other are tested to the limit. Battling their ups and downs, both realize that love is a leap of faith that can only be taken by those who dare to love.', 26, '7.500'),
('Arrival', 'Drama, Mystery, Sci-Fi', 'Denis Villeneuve', 'Eric Heisserer (screenplay), Ted Chiang (based on the story &quot;Story of Your Life&quot; written by)', 'Amy Adams, Jeremy Renner, Forest Whitaker', '11 November 2016 (USA)', 'USA', 'English', '1h 56min', 'A linguist is recruited by the military to assist in translating alien communications.', 'When mysterious spacecraft touch down across the globe, an elite team - led by expert linguist Louise Banks - is brought together to investigate. As mankind teeters on the verge of global war, Banks and the team race against time for answers - and to find them, she will take a chance that could threaten her life, and quite possibly humanity.', 8, '8.000'),
('Interstellar', 'Adventure, Drama, Sci-Fi', 'Christopher Nolan', 'Jonathan Nolan, Christopher Nolan', 'Matthew McConaughey, Anne Hathaway, Jessica Chastain', '7 November 2014 (USA)', 'USA', 'English', '2h 49min', 'A team of explorers travel through a wormhole in space in an attempt to ensure humanity survival.', 'Earth future has been riddled by disasters, famines, and droughts. There is only one way to ensure mankind survival: Interstellar travel. A newly discovered wormhole in the far reaches of our solar system allows a team of astronauts to go where no man has gone before, a planet that may have the right environment to sustain human life.', 9, '8.852'),
('Sultan', 'Action, Drama, Romance', 'Ali Abbas Zafar', 'Ali Abbas Zafar', 'Salman Khan, Anushka Sharma, Randeep Hooda', '6 July 2016 (USA)', 'India', 'Hindi', '2h 50min', 'A romantic action drama based on the life of fictional Haryana based wrestler &amp; mixed martial arts specialist Sultan Ali Khan.', 'Sultan is a story of Sultan Ali Khan - a local wrestling champion with the world at his feet as he dreams of representing India at the Olympics. It is a story of Aarfa - a feisty young girl from the same small town as Sultan with her own set of dreams. When the 2 local wrestling legends lock horns, romance blossoms and their dreams and aspirations become intertwined and aligned. However, the path to glory is a rocky one and one must fall several times before one stands victorious - More often than not, this journey can take a lifetime. Sultan is a classic underdog tale about a wrestler journey, looking for a comeback by defeating all odds staked up against him. But when he has nothing to lose and everything to gain in this fight for his life match... Sultan must literally fight for his life. Sultan believes he has got what it takes... but this time, it is going to take everything he has got.', 10, '8.973'),
('Deadpool', 'Action, Adventure, Comedy', 'Tim Miller', 'Rhett Reese, Paul Wernick', 'Ryan Reynolds, Morena Baccarin, T.J. Miller', '12 February 2016 (USA)', 'USA', 'English', '1h 48min', 'A fast-talking mercenary with a morbid sense of humor is subjected to a rogue experiment that leaves him with accelerated healing powers and a quest for revenge.', 'This is the origin story of former Special Forces operative turned mercenary Wade Wilson, who after being subjected to a rogue experiment that leaves him with accelerated healing powers, adopts the alter ego Deadpool. Armed with his new abilities and a dark, twisted sense of humor, Deadpool hunts down the man who nearly destroyed his life.', 27, '6.244'),
('The Accountant', 'Action, Crime, Drama', 'Gavin O\'Connor', 'Bill Dubuque', 'Ben Affleck, Anna Kendrick, J.K. Simmons ', '14 October 2016 (USA)', 'USA', 'English', '2h 8min ', 'As a math savant uncooks the books for a new client, the Treasury Department closes in on his activities and the body count starts to rise.', 'Christian Wolff is a math savant with more affinity for numbers than people. Behind the cover of a small-town CPA office, he works as a freelance accountant for some of the world\'s most dangerous criminal organizations. With the Treasury Department\'s Crime Enforcement Division, run by Ray King, starting to close in, Christian takes on a legitimate client: a state-of-the-art robotics company where an accounting clerk has discovered a discrepancy involving millions of dollars. But as Christian uncooks the books and gets closer to the truth, it is the body count that starts to rise.', 28, '6.875'),
('Warcraft: The Beginning', 'Action, Adventure, Fantasy', 'Duncan Jones', 'Charles Leavitt (screenplay), Duncan Jones (screenplay)', 'Travis Fimmel, Paula Patton, Ben Foster', '10 June 2016 (USA)', 'USA', 'English', '123 min', 'As an Orc horde invades the planet Azeroth using a magic portal, a few human heroes and dissenting Orcs must attempt to stop the true evil behind this war.', 'When the world of the Orcs Draenor is being destroyed by the evil fel magic that uses life-force, the powerful warlock Gul\'dan creates a portal to the world of Azeroth and forms the Horde with members of the Orc clans. He also captures many prisoners to keep the portal. The king of Azeroth Llane Wrynn and his brother-in-law Anduin Lothar are informed by the apprentice of magician Khadgar that he has found fel magic in dead bodies and the king decides to summon the Guardian of Tirisfal Medivh to protect his kingdom. Lothar and Khadgar head Kharazhan to meet Medivh and a shadow points a book to Khadgar and he takes it and hides. Anduin, Khadgar and Medivh and a group of soldiers are attacked by Orcs and they capture the slave Garona, who is released by King Llane, and she shows the location of the portal. Garona is contacted by the Orc chief of a clan Durotan that wants to meet King Llane to stop the fel magic. ', 29, '9.279'),
('Dear Zindagi', 'Drama, Romance ', 'Gauri Shinde', 'Gauri Shinde', 'Alia Bhatt, Shah Rukh Khan, Kunal Kapoor ', ' 23 November 2016 (USA)', 'India', 'Hindi', '2h 31min', 'Kaira is a budding cinematographer in search of a perfect life. Her encounter with Jug, an unconventional thinker, helps her gain a new perspective on life. She discovers that happiness is all about finding comfort in life\'s imperfections.', 'This is the story of Kaira, a budding cinematographer in search of perfect life. A chance encounter with Jug, an unconventional thinker, helps her gain new perspective about life. She discovers that happiness is all about finding comfort in life\'s imperfections.', 30, '7.149');
